import React, { useState } from "react";

const Contact = () => {
  const [form, setForm] = useState({
    name: "",
    email: "",
    phone: "",
    subject: "",
    message: ""
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const emailSubject = form.subject || "General Inquiry - WatchHK";
    const emailBody = `
Name: ${form.name}
Email: ${form.email}
Phone: ${form.phone}

Subject: ${form.subject}

Message:
${form.message}
    `.trim();

    window.location.href = `mailto:your@email.com?subject=${encodeURIComponent(emailSubject)}&body=${encodeURIComponent(emailBody)}`;
  };

  return (
    <div
      className="container"
      style={{ paddingTop: "2rem", paddingBottom: "3rem" }}
    >
      <h1 style={{ marginBottom: "2rem" }}> Contact Us </h1>{" "}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr",
          gap: "3rem",
          marginBottom: "3rem"
        }}
      >
        <div>
          <h2 style={{ marginBottom: "1.5rem", color: "#d4af37" }}>
            {" "}
            Get in Touch{" "}
          </h2>{" "}
          <p style={{ lineHeight: "1.8", color: "#555", marginBottom: "2rem" }}>
            Have questions about our luxury timepieces ? Our expert team is here
            to help.Fill out the form and we 'll get back to you within 24
            hours.{" "}
          </p>{" "}
          <div style={{ marginBottom: "2rem" }}>
            <h3 style={{ marginBottom: "1rem", fontSize: "1.2rem" }}>
              {" "}
              Contact Information{" "}
            </h3>{" "}
            <div style={{ lineHeight: "2.5", color: "#555" }}>
              <div style={{ marginBottom: "1rem" }}>
                <strong> Email : </strong> <br />
                <a href="mailto:info@watchhk.com" style={{ color: "#d4af37" }}>
                  {" "}
                </a>{" "}
              </div>{" "}
              <div style={{ marginBottom: "1rem" }}>
                <strong> Phone: </strong> <br />
                <a href="tel:+9771234567890" style={{ color: "#d4af37" }}>
                  +977 1234 567 890{" "}
                </a>{" "}
              </div>{" "}
              <div style={{ marginBottom: "1rem" }}>
                <strong> WhatsApp: </strong> <br />
                <a
                  href="https://wa.me/9771234567890"
                  style={{ color: "#d4af37" }}
                >
                  +977 1234 567 890{" "}
                </a>{" "}
              </div>{" "}
              <div>
                <strong> Address: </strong> <br />
                Shiva Saloon,prayag Pokhari Marg,Lalitpur 4 <br />
                Nepal{" "}
              </div>{" "}
            </div>{" "}
          </div>{" "}
          <div
            style={{
              background: "#f9f9f9",
              padding: "1.5rem",
              borderRadius: "8px"
            }}
          >
            <h3 style={{ marginBottom: "1rem", fontSize: "1.2rem" }}>
              {" "}
              Business Hours{" "}
            </h3>{" "}
            <div style={{ lineHeight: "2", color: "#555" }}>
              <div> Monday - Friday: 10: 00 AM - 7: 00 PM </div>{" "}
              <div> Saturday: 10: 00 AM - 6: 00 PM </div>{" "}
              <div> Sunday: Closed </div>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
        <div>
          <div
            style={{
              background: "white",
              padding: "2rem",
              borderRadius: "8px",
              boxShadow: "0 2px 8px rgba(0,0,0,0.1)"
            }}
          >
            <h2 style={{ marginBottom: "1.5rem" }}> Send us a Message </h2>{" "}
            <form onSubmit={handleSubmit}>
              <div style={{ marginBottom: "1.5rem" }}>
                <label
                  style={{
                    display: "block",
                    marginBottom: "0.5rem",
                    fontWeight: "600"
                  }}
                >
                  Full Name *
                </label>{" "}
                <input
                  type="text"
                  name="name"
                  value={form.name}
                  onChange={handleChange}
                  placeholder="Enter your full name"
                  required
                  style={{
                    width: "100%",
                    padding: "0.75rem",
                    border: "1px solid #ddd",
                    borderRadius: "4px",
                    fontSize: "1rem"
                  }}
                />{" "}
              </div>{" "}
              <div style={{ marginBottom: "1.5rem" }}>
                <label
                  style={{
                    display: "block",
                    marginBottom: "0.5rem",
                    fontWeight: "600"
                  }}
                >
                  Email Address *
                </label>{" "}
                <input
                  type="email"
                  name="email"
                  value={form.email}
                  onChange={handleChange}
                  placeholder="your.email@example.com"
                  required
                  style={{
                    width: "100%",
                    padding: "0.75rem",
                    border: "1px solid #ddd",
                    borderRadius: "4px",
                    fontSize: "1rem"
                  }}
                />{" "}
              </div>{" "}
              <div style={{ marginBottom: "1.5rem" }}>
                <label
                  style={{
                    display: "block",
                    marginBottom: "0.5rem",
                    fontWeight: "600"
                  }}
                >
                  Phone Number{" "}
                </label>{" "}
                <input
                  type="tel"
                  name="phone"
                  value={form.phone}
                  onChange={handleChange}
                  placeholder="+977 1234 567 890"
                  style={{
                    width: "100%",
                    padding: "0.75rem",
                    border: "1px solid #ddd",
                    borderRadius: "4px",
                    fontSize: "1rem"
                  }}
                />{" "}
              </div>{" "}
              <div style={{ marginBottom: "1.5rem" }}>
                <label
                  style={{
                    display: "block",
                    marginBottom: "0.5rem",
                    fontWeight: "600"
                  }}
                >
                  Subject *
                </label>{" "}
                <input
                  type="text"
                  name="subject"
                  value={form.subject}
                  onChange={handleChange}
                  placeholder="What is this regarding?"
                  required
                  style={{
                    width: "100%",
                    padding: "0.75rem",
